import React from "react";
import "./styles.sass";
import MediaQuery from "react-responsive";

import Header from "../Header";
import Footer from "../Footer";
import Body from "../Body";
import Slides from "../Slides";

const Index = () => {
  return (
    <>
      <Header />
      <Body />
      <Slides />
      <Footer />
    </>
  );
};

export default Index;
